import React from "react";

export default function Form({ titulo, culto, orderListagem }) {
  console.log(orderListagem, "orderListagem");
  return (
    <>
      <h1>{titulo}</h1>
      <table>
        <thead>
          <tr>
            <th>Nome</th>
            <th>Rede</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {orderListagem && (
            <>
              {orderListagem.map((individuo) => {
                return (
                  <>
                    {individuo.map((ind) => {
                      if (ind.culto == culto) {
                        return (
                          <tr key={ind} className={individuo[0]}>
                            <td>
                              {ind.nome} {ind.sobrenome}
                            </td>
                            <td>Pr {ind.rede}</td>
                            <td>
                              <button
                                className="remove"
                                onClick={(e) => doRemove(individuo[0])}
                              >
                                Remover
                              </button>
                            </td>
                          </tr>
                        );
                      }
                    })}
                  </>
                );
              })}
            </>
          )}
        </tbody>
      </table>
    </>
  );
}
